import './App.css';
import React, { Component } from 'react'
import Nav from './Components/Nav';
import Heading from './Components/Heading';
import NewsComponent from './Components/NewsComponent';
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";
export default class App extends Component {
  render() {
    return (
      <>
        <Heading />

        <BrowserRouter>
          <Nav />
          <Routes>
            <Route path="/" element={<NewsComponent country='in' catogary='general' />}></Route>
            <Route path="/Business" element={<NewsComponent country='in' catogary='business' />}></Route>
            <Route path="/Sports" element={<NewsComponent country='in' catogary='sports' />}></Route>
            <Route path="/Entertainment" element={<NewsComponent country='in' catogary='entertainment' />}></Route>
            <Route path="/Health" element={<NewsComponent country='in' catogary='health' />}></Route>
            <Route path="/Science" element={<NewsComponent country='in' catogary='science' />}></Route>
            <Route path="/Sports" element={<NewsComponent country='in' catogary='sports' />}></Route>

          </Routes>
        </BrowserRouter>
      </>
    )
  }
}
